const About = () =>{


    return (
        <div>
            <h1>MICHAEL MEDINA</h1>
            <video>
            <iframe 
                width="560" 
                height="315" 
                src="https://www.youtube.com/embed/XdkAe2BFCZw?si=_7v2h1UFNNGmhO1l" 
                title="YouTube video player" 
                frameborder="0" 
                allowfullscreen />
            </video>
        </div>
    );
}

export default About;
